(125, 3, 65, 'sLgnFailG', 'sLgnFailG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID, count(LOGIN_SEQ) as LOGIN_CNT \nFROM CMN_LOG_LOGIN\nWHERE SUCCESS_YN = \'N\'\nGROUP by USR_ID ORDER BY count(login_seq) desc', NULL, '20180511142644', NULL),
(126, 3, 65, 'sLgnIpG', 'sLgnIpG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT REMOTE_ADDR, count(LOGIN_SEQ) as LOGIN_CNT \nFROM CMN_LOG_LOGIN\nWHERE SUCCESS_YN = \'N\'\nGROUP by REMOTE_ADDR ORDER BY count(login_seq) desc', NULL, '20180511142716', NULL),
(127, 3, 65, 'sAuthNoG', 'sAuthNoG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID,count(LAUTH_SEQ) as AUTH_CNT\nFROM `CMN_LOG_AUTH` \nWHERE SUCCESS_YN = \'N\'\nGROUP BY USR_ID\nORDER BY count(LAUTH_SEQ) desc', NULL, '20180511142741', NULL),
(128, 3, 65, 'sLgnLockG', 'sLgnLockG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID, count(LOGIN_SEQ) as LOGIN_CNT \nFROM CMN_LOG_LOGIN\nWHERE LOCKCD in (\'GOLOCK\')\nGROUP by USR_ID ORDER BY count(login_seq) desc ', NULL, '20180511142804', NULL),
(129, 3, 65, 'sAuthPiG', 'sAuthPiG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT b.USR_ID,count(a.LAUTHD_SEQ) as REQ_PI_CNT,sum(a.ROW_CNT) as VIEW_ROW_SUM \nFROM CMN_LOG_AUTHD a\n	JOIN CMN_LOG_AUTH b ON a.REQ_TOKEN = b.REQ_TOKEN\nWHERE PI_IN_COLIDS != \'\' AND PI_IN_COLIDS is not NULL\nGROUP BY b.USR_ID\nORDER BY count(a.ROW_CNT) desc', NULL, '20180511142828', NULL),
(130, 3, 65, 'iMonthG', 'iMonthG', 4, 'C', 'RTN_INT', 0, 'INSERT INTO CMN_LOG_CFM (\n	FROM_DT, TO_DT, CFM_DESC, ADD_DT, ADD_ID \n) VALUES (\n	replace(#{G2-FROM_DT},\'.\',\'\'), replace(#{G2-TO_DT},\'.\',\'\'), #{G2-CFM_DESC}, date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n)', NULL, '20180511142906', '20180511150351'),
(131, 3, 65, 'sMonthG', 'sMonthG', 4, 'R', 'RTN_SELECT_ONE', 0, 'SELECT #{G1-FROM_DT} as FROM_DT, #{G1-TO_DT} as TO_DT', NULL, '20180511142946', '20180511150155'),
(132, 3, 65, 's2MonthG', 's2MonthG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	CFM_SEQ, FROM_DT, TO_DT, CFM_DESC, ADD_DT\n	, ADD_ID\nFROM CMN_LOG_CFM\nORDER BY CFM_SEQ DESC', NULL, '20180511143012', NULL),
(133, 3, 66, 'sLogin', 'LOGIN', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT substring(add_dt,1,8) as LOGIN_DT\n	, count(login_seq) as LOGIN_CNT \n	, count(login_seq)+10 as LOGIN_CNT2\nFROM CMN_LOG_LOGIN\nGROUP BY substring(add_dt,1,8)\nORDER BY substring(add_dt,1,8)\n', NULL, '20180515205842', '20180524081848'),
(134, 3, 67, 'sPgmG', 'PGM', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n        0 as CHK, PGMSEQ, PGMID, PGMNM, PKGGRP, VIEWURL, PGMTYPE, SECTYPE, ADDDT, MODDT\n    FROM \n        CG.CG_PGMINFO\n    WHERE PJTSEQ = #{G1-PJTSEQ}\n', NULL, '20180528073431', '20180528080545'),
(135, 3, 67, 'sAuthG', 'AUTH', 3, 'R', 'RTN_SELECT_LIST', 0, '  SELECT \n 		0 as CHK\n		, concat(p.PGMID,\'-\',g.GRPID,\'_\',f.FNCID) as ROWID\n      ,p.PGMID \n      ,concat(g.GRPID,\'_\',f.FNCID) as AUTH_ID\n      ,concat(g.GRPNM,\'_\',f.FNCNM) as AUTH_NM \n  FROM \n      CG.CG_PGMGRP g\n      JOIN CG.CG_PGMFNC f on g.GRPSEQ = f.GRPSEQ and g.PGMSEQ = f.PGMSEQ\n      JOIN CG.CG_PGMINFO p on p.PGMSEQ = g.PGMSEQ\n  WHERE p.PJTSEQ = #{G1-PJTSEQ} AND ( f.FNCTYPE != \'\' && f.FNCTYPE is not null )\n      order by p.PGMID,g.GRPORD asc,f.FNCORD asc  \n', NULL, '20180528073504', '20180528080545'),
(136, 3, 67, 'sFileG', 'FILE', 3, 'R', 'RTN_SELECT_LIST', 0, '    SELECT \n        0 as CHK, PGMSEQ, VERSEQ, FILESEQ, FILETYPE, FILENM, FILEHASH, FILESIZE, ADDDT, MODDT\n    FROM \n        CG.CG_RSTFILE\n    WHERE PJTSEQ = #{G1-PJTSEQ} and ACTIVEYN = \'Y\'\n', NULL, '20180528073504', '20180528081305'),
