(143, 3, 71, 'sPjtList', 'PJT', 3, 'R', 'RTN_SELECT_LIST', 0, 'select\n	PJTSEQ,PJTID,PJTNM,FILECHARSET,UITOOL\n	,SVRLANG,DEPLOYKEY,PKGROOT,STARTDT,ENDDT\n	,DELYN,ADDDT,MODDT \nfrom\n CG_PJTINFO	\nwhere DELYN = \'N\'\n', NULL, '20180716171228', '20180716171445'),
(144, 24, 70, 'sLoadD', 'LOADD', 5, 'R', 'RTN_SELECT_LIST', 0, 'select\n	LOADD_SEQ, LOAD_SEQ ,TYPE, PRIORITY, CLASSNAME, \n	CLASS_LINE_S, CLASS_LINE_E, SOURCEFILE, SOURCEPATH, METHOD_NAME\n	, METHOD_LINE_S, METHOD_LINE_E, FIELD_NAME, FIELD_LINE_S, FIELD_LINE_E\n	, LINE_CNT, BUG_LINE_S, ADD_DT\nfrom\n	FILELOADD\nwhere LOAD_SEQ = #{G2-LOAD_SEQ}\norder by LOADD_SEQ desc', NULL, '20180716173205', '20180719095320'),
(145, 24, 70, 'sLoad', 'LOAD', 5, 'R', 'RTN_SELECT_LIST', 0, 'select \n	0 as CHK, \'\' as CAL, LOAD_SEQ, FILE_NM, TEAM_NM, length(TEAM_NM) as TEAM_NM_LEN\n	, SYS_NM, length(SYS_NM) as SYS_NM_LEN, SUBSYS_NM, length(ifnull(SUBSYS_NM,\'\')) as SUBSYS_NM_LEN, FILE_HASH\n	, XML_VERSION, XML_TIMESTAMP, XML_ANAL_TIMESTAMP, XML_DT, XML_ANAL_DT\n	, BUG_CNT, LOAD_END_DT\n	, ADD_DT, MOD_DT\nfrom \n	FILELOAD\nwhere file_nm like concat(\'%\',#{G1-FILE_NM},\'%\') \n	and team_nm like  concat(\'%\',#{G1-TEAM_NM},\'%\') \norder by LOAD_SEQ desc\n\n', NULL, '20180716173205', '20190529074127'),
(146, 24, 72, 'sList', 'sList', 5, 'R', 'RTN_SELECT_LIST', 0, 'select\n	VUL_SEQ, TEAM_NM, SYS_NM, SUBSYS_NM, FILE_NM\n	, RULESET_ID, SOURCEPATH, PRIORITY, VUL_CNT, ADD_DT\n	, MOD_DT\nfrom VULINFO\nwhere TEAM_NM like concat(\'%\',#{G1-TEAM_NM},\'%\')\norder by VUL_SEQ desc', NULL, '20180716181854', '20180718105411'),
(147, 24, 72, 'uList', 'uList', 5, 'U', 'RTN_SELECT_LIST', 0, 'update VULINFO\nset \n	TEAM_NM = #{TEAM_NM}, SYS_NM = #{SYS_NM}, SUBSYS_NM = #{SUBSYS_NM},\n	, MOD_DT = date_format(sysdate(),\'%Y%m%d%H%i%s\') \nwhere VUL_SEQ = #{VUL_SEQ}\n', NULL, '20180718105727', NULL),
(148, 24, 70, 'dLoad', 'LOAD', 5, 'D', 'RTN_INT', 0, 'delete from FILELOAD where LOAD_SEQ = #{LOAD_SEQ}', NULL, '20180719095320', NULL),
(149, 24, 70, 'uLoad', 'LOAD', 5, 'U', 'RTN_INT', 0, 'update FILELOAD\nset \n	TEAM_NM = #{TEAM_NM}\n	, SYS_NM = #{SYS_NM}\n	, SUBSYS_NM = #{SUBSYS_NM}\n	, MOD_DT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere LOAD_SEQ = #{LOAD_SEQ}', NULL, '20180719103616', '20180719105021'),
(150, 24, 69, 'sTeam', 'TEAM2', 5, 'R', 'RTN_SELECT_LIST', 0, 'select uuid() as UUID_SEQ, c.TEAM_NM\n, sum( case when priority = 1 then 1 else 0 end ) as PRIORITY_1\n, sum( case when priority = 2 then 1 else 0 end ) as PRIORITY_2\n, sum( case when priority = 3 then 1 else 0 end ) as PRIORITY_3\n, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	TEAMINFO c\n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc', NULL, '20180719144446', '20181015203225'),
(151, 24, 69, 'sSys', 'SYS', 5, 'R', 'RTN_SELECT_LIST', 0, 'select UUID() as UUID_SEQ, TEAM_NM,SYS_NM, SUBSYS_NM, count(b.LOADD_SEQ) as VUL_CNT\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM  = #{G3-TEAM_NM}\ngroup by TEAM_NM, SYS_NM, SUBSYS_NM\norder by count(b.LOADD_SEQ) desc', NULL, '20180719154513', '20180720082950'),
(152, 24, 69, 'sRule', 'RULESET', 5, 'R', 'RTN_SELECT_LIST', 0, 'select UUID() as UUID_SEQ, TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE as RULESET, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM = #{G4-TEAM_NM} and \n 	case \n		when #{G4-SUBSYS_NM} = \'\' then \n 			a.SUBSYS_NM  = \'\' or a.SUBSYS_NM is null\n		else a.SUBSYS_NM = #{G4-SUBSYS_NM}\n	end \n	and a.SYS_NM = #{G4-SYS_NM} \ngroup by TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE\norder by count(b.LOADD_SEQ) desc', NULL, '20180719154906', '20180719164116'),
(153, 24, 69, 'sTeamChart', 'TEAM', 5, 'R', 'RTN_SELECT_LIST', 0, 'select c.TEAM_NM, count(distinct b.type) as TYPE_CNT, ifnull(count(b.LOADD_SEQ),0) as VUL_CNT\nfrom \n	TEAMINFO c \n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere \ncase when #{G1-EX_TEAM_NM} <> \'\' then c.TEAM_NM <> #{G1-EX_TEAM_NM} \n	else\n		1=1\n	end\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc', NULL, '20180719155451', '20180720083033'),
